Verenigde Staten
Komedie

geregisseerd door Garrett Brawith
met Kevin Sorbo, Ross Patterson en Danny Trejo

Vietnam-veteraan Sal Bando (Kevin Sorbo) wordt gekweld door zijn verleden als schoonmaker van zwembaden en keert terug naar Van Nuys, California. Hier lijkt het alsof alleen de Mexicanen de bedrijven runnen die zwembaden schoonmaken. Bando begint aan een wrede missie om zijn &quot;rechtmatige&quot; roeping terug te winnen en wraak te nemen op Caesar (Danny Trejo), de man die zijn vrouw en kind vermoord heeft.

